public class Editor {
private Number id;
private String name;
private String systbot;

    public Number getId() {
        return id;
    }

    public void setId(Number id) {
        this.id = id;
    }

    public String getName() {
        return name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public String getSystbot() {
        return systbot;
    }

    public void setSystbot(String systbot) {
        this.systbot = systbot;
    }


}
